import styles from './Card.module.css'
const Cart1 = ({ names ,deleteHandel}) => {
    return (
        <div>
            {names.map(({id,name,age,phone,address,type}) => {
                return (
                    <div key={id} className={styles.cardwrapper} style={{backgroundColor : type === 'men'? 'blue' :'pink'}}>
                        <div>Name : {name}</div>
                        <div>Age : { age}</div>
                        <div>Phone : { phone}</div>
                        <div>Address : {address}</div>

                        <div className={styles.deleteBtn} onClick={(event) => deleteHandel(event,index)}>x</div>
                    </div>
                )
            })}
        </div>
    )
}

export default Cart1
